import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { id: 'e1', title: "Apply for Passport", amount: 150, date: new Date(2023, 1, 24) },
    { id: 'e2', title: "Buy Sneakers", amount: 15000, date: new Date(2023, 1, 27) },
    { id: 'e3', title: "Learn Machine Learning", amount: 0, date: new Date(2023, 1, 30) },
    { id: 'e4', title: "Freelancing", amount: 0, date: new Date(2023, 2, 1) },
  ];

  return (
    <div>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        amount={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        amount={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[3].title}
        amount={expenses[3].amount}
        date={expenses[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
